import {GetGenre, PostActiveGenre} from '../../redux/actions/movie'
import CardMovie from '../CardMovie'
import {GetMovieGenre} from '../../redux/actions/movie'


var data = [1,2,3]
class ListMovieGenre extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            genres : []
        }
    }
    componentDidMount(){
        this.props.dispatch(GetMovieGenre(this.props.move.genre.id,1))
    }
    render(){
        const {moviesGenre, genre} = this.props.movie
        return (
            <>
                <Grid container spacing={2}>
                    {
                        data.map(value => (
                            <Grid item key={value} xs={12} sm={12} md={6} lg={3} xl={3}>
                                <Link color="inherit" underline="none">
                                    <CardMovie />
                                </Link>
                            </Grid>
                        ))
                    }
                </Grid>
            </>
        )
    }
}

const mapStateToProps = (state) => ({
    movie : state.movie
})

export default connect(mapStateToProps)(ListMovieGenre)
